const Card = () => {
    return (
        <>

            <Card style={{ width: '18rem' }}>
                <Card.Header>City Name</Card.Header>
                <ListGroup variant="flush">
                    <ListGroup.Item> <h2>Date</h2>
                        <h2>Month</h2>
                        <h2>Year</h2></ListGroup.Item>
                    <ListGroup.Item>City Name</ListGroup.Item>
                    <ListGroup.Item><h3><i class="fa-solid fa-cloud"></i> humidity</h3></ListGroup.Item>
                    <ListGroup.Item>
               </ListGroup.Item>
                </ListGroup>
            </Card>
           
        </>
    )
}
export default Card;
